    components: { Swiper, SwiperSlide },
    props: {
      industryId: 0, // 行业id, 用于请求行业模板
    },
    data() {
      return {
        swiperOptions: {
          spaceBetween: 100,
          slidesPerView: 'auto',
          navigation: {
            nextEl: '.swiper-button-next',
            prevEl: '.swiper-button-prev'
