          cancelText: "我再想想"
        }).then(() => {
          this.isShowConfigureBox = true;
          // this._apis.profile.intelligentEnableTemplate(data).then(()=> {})

        }).catch();
      },

      /** 查询配置进度 */
      timer() {
        this.timerConfigure = setInterval(() => {
          // this._apis.profile.intelligentConfigurationStatus()

        }, 1500)
      },

