      againConfigure() {

        // this._apis.profile.intelligentEnableTemplate()
      },

      /** 设置是否启用swiper */
      settingSwiper() {
        console.log('%c' + this.swiper.width, 'color: deepskyblue');
        if(this.swiper.width >= (256 * 5 + 100 * 4)) {
          this.useSwiper = false
        }else {
          this.useSwiper = true
        }
      },


      /** 展示二维码 */
      showPreview() {

      },

